function LessonsHeroSection() {
  return (
    <section className='hero-section-secondary'>
      <div className='hero-section-secondary__container'>
        <h2 className='hero-section-secondary__title'>Lekcie o živici </h2>
        <div className='hero-section-secondary__text'>
          <p>Hlavná stránka</p>
          <p className='hero-section-secondary__text-accent'>
            Lekcie o živici{' '}
          </p>
        </div>
      </div>
    </section>
  );
}
export default LessonsHeroSection;
